import React, { Component } from 'react'

export default class Autenticador extends Component {

    constructor(props){
        super(props);

        this.state = {
            github_login: ""
        }
    }


    render() {
        return (
            <div className = "Autenticador">
                <h2>Github Search</h2>
                <input type="text"></input>
            </div>
        )
    }
}
